# Definir a estrutura da pilha de dados como uma classe de pilha.
class Stack:

  def __init__(self): # __init__(self) construtor inicializa o campo de membro da pilha em uma lista vazia.
    self.stack = []

  def is_empty(self):
    return True if len(self.stack) == 0 else False

  def push(self, item):
    self.stack.append(item)

  def pop(self):
    return None if self.is_empty() else self.stack.pop()

  def peek(self): # método peek() permite saber qual elemento está no topo da pilha.
    return None if is_empty(self.stack) else self.stack[-1]

# Testando a classe da pilha
stack = Stack()
stack.push("A")
stack.push("B")
print(stack.pop())
stack.push("C")
print(stack.pop())

print(stack.peek())

# Estrutura de pilha de dados que verifica facilmente se os parênteses estão devidamente emparelhados
def check_parentheses (expr):
    opening = "[{("
    closing = "]})"
    stack = Stack()
    for char in expr:
        if char in opening:
            stack.push(char)
        elif char in closing:
            if stack.is_empty():
                return False
            if opening.index(stack.pop()) != closing.index(char):
                return False
    return stack.is_empty()

str = input ("Input a string of parentheses: ")
print ("Valid" if check_parentheses(str) else "Invalid")

"""## **Unidade 23: Fila**

**Definição de uma fila**
- Uma fila é um tipo de dado abstrato onde somente a eliminação é possível na frente e somente a adição é possível na parte de trás.
- Funciona pelo método FIFO (First-In-First-Out), o primeiro item adicionado também é o removido.
- Deve fornecer duas interfaces importantes:
  - enqueue: adiciona um novo item à parte de trás da fila
  - dequeue: apaga um item da frente da fila

![image.png](data:image/png;base64,)
"""

# Classe de fila - define uma fila como uma lista de tipos de dados
class Queue:

  def __init__(self): # __init__(self) construtor inicia o campo de membro da fila em uma lista vazia
     self.queue = []

  def is_empty(self): # is_empty() usado para verificar uma fila vazia
     return True if len(self.queue) == 0 else False

  def enqueue (self, item): # enqueue() recebe o 'self' e o item a ser adicionado à fila como parâmetros
     self.queue.append(item)

  def dequeue(self): # dequeue() recebe 'self' como um parâmetro
     return None if self.is_empty() else self.queue.pop(0) # retorna none se self.is_empty() for True, e se não for, retorna apagando o último elemento da fila self.queue.

  def size(self): # fornece o número atual de elementos na fila (comprimento)
      return len(self.queue)

# Testando a estrutura de fila
queue = Queue()
queue.enqueue("A")
queue.enqueue("B")
print(queue.dequeue())
queue.enqueue("C")
print(queue.dequeue())
print(queue.dequeue())
print(queue.dequeue())
print(queue.size())

"""## **Unidade 24: Pesquisa Sequencial**

**Busca Sequencial**
- Se refere a um algoritmo que faz investigação verificando todos os itens um a um em ordem.
"""

# Um algoritmo para a busca sequencial
def seq_search(nums, x):
   for i in range(len(nums)):
       if x == nums[i]:
         return i
   return -1

# Existe um número inteiro x aleatório no S, o conjunto de números inteiros dados?
S = [11, 37, 45, 26, 59, 28, 17, 53]
x = 53
pos = seq_search(S, x)
print(f"In S, {x} is at postion {pos}.")

# Um algoritmo para encontrar a maior chave
def find_largest (nums):
    largest = 0
    for i in range (1,len(nums)):
         if nums[largest] < nums[i]:
            largest = i
    return largest

nums = [11, 37, 45, 26, 59, 28, 17, 53]
pos = find_largest(nums)
print(f"The largest is {nums[pos]} at {pos}")

"""## **Unidade 25: Pesquisa Binária**

**Busca Binária**
- Compara o valor médio que se encontra entre low e high.
- Dividindo repetidamente pela metade a porção da lista que deve conter o item, até reduzir as localizações possíveis a apenas uma.
"""

# Algoritmo de busca binária

def bin_search(nums, x):
    low, high = 0, len(nums) - 1
    while low <= high:
        mid = (low + high) // 2
        if nums [mid] == x:
            return mid
        elif nums[mid] > x:
            high = mid - 1
        else:
            low = mid + 1
    return -1 # retornar -1 se x não for encontrado no processo de busca binária.

# Existe um número inteiro x aleatório no S, um conjunto de números inteiros ordenados?
S = [11, 17, 26, 28, 37, 45, 53, 59]
x = int(input("Input the number to search: "))
pos = bin_search(S, x)
print(f"In S, {x} is at position {pos}.")

# Avaliação de desempenho
def bin_search(nums, x):
    low, high = 0, len(nums) - 1
    operations = 0
    while low <= high:
        mid = (low + high) // 2
        operations += 1
        if nums[mid] == x:
            print("Total binary search operations:", operations)
            return mid
        elif nums[mid] > x:
            high = mid - 1
        else:
            low = mid + 1
    print("Total binary search operations:", operations)
    return -1

S = [11, 17, 26, 28, 37, 45, 53, 59]
x = int(input("Input the number to search: "))
pos = bin_search(S, x)
print(f"In S, {x} is at position {pos}.")

"""## **Unidade 26: Tabela Hash**

**Definição de hash table**
- Hash Table or Hash Map: refere-se a um tipo de dado abstrato que armazena e extrai dados através do mapeamento de chaves de valores através de hash.
- Hashing refere-se a designar os locais para salvar dados ou encontrar dados salvos por valores de dados. A função determina a chave usando o valor dos dados.
- Deve fornecer três interfaces:
  - put (key, valor): Armazena o valor no balde designado pelo valor da chave hash
  - get (key): Extrai o valor armazenado no balde designado pelo valor da chave hash  
  - hash (key): Converte o valor da chave de dados em um valor de hash em um intervalo específico

![image.png](data:image/png;base64,)
"""

# Use a soma dos Códigos ASCII do título do livro como o valor chave do livro.
