"""- **Hashing** refere-se a um processo de conversão de uma dada chave em outra chave, e função **hash** refere-se a uma função que converte uma chave de comprimento aleatório em outra chave que tem um comprimento fixo. A chave convertida pela **função hash** é chamada de **chave hash**."""

# Clase da Hash Table
class HashTable:

    def __init__(self, size): # inicializa a hash table no tamanho da chave dada.
        self.size = size
        self.table = {}
        for i in range(size):
            self.table[i] = []

    def hash(self, key): # função que executa a aritmética modular com o tamanho de uma determinada chave.
        return key % self.size

    def get(self, key): # recebe a chave como entrada e retorna o balde de chave hash.
        return self.table[self.hash(key)]

    def put(self, key, value): # recebe chave e valor como entrada e armazena o valor no "balde" de chave hash.
        bucket = self.table[self.hash(key)]
        if value not in bucket:
           bucket.append(value)

# Inicializar a hash table que foi previamente definida em uma tabela com 8 baldes.
table = HashTable(8)
for key in table.table.keys():
  print(key, table.table[key])

